import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom"; // React Router v5 components
import { Navigation } from "./components/navigation";
import { Header } from "./components/header";
import About from "./components/about";
import Footer from "./components/footer";
import Login from "./components/Login";
import Signup from "./components/Signup";
import SmoothScroll from "smooth-scroll";
import "./App.css";

// Initialize smooth scrolling for navigation links
export const scroll = new SmoothScroll('a[href*="#"]', {
  speed: 1000,
  speedAsDuration: true,
});

const App = () => {
  const [landingPageData] = useState({});

  useEffect(() => {
    // Set landing page data if required
    // setLandingPageData(JsonData);
  }, []);

  return (
    <Router>
      <Navigation />
      <Switch>
        <Route exact path="/" component={() => <Header data={landingPageData.Header} />} />
        <Route path="/about" component={About} />
        <Route path="/Login" component={Login} />
        <Route path="/Signup" component={Signup} />
        {/* Add additional routes for Login, Signup, etc., here */}
      </Switch>
      <Footer />
    </Router>
  );
};

export default App;
